const Layout = ({children}) => {
    const nav = () =>  (
        <>
        <ul className="nav">
            <li><a href="">Home</a></li>
        </ul>
        <ul className="nav">
            <li><a href="">Login</a></li>
        </ul>
        <ul className="nav">
            <li><a href="">Register</a></li>
        </ul>
        </>
    );
    return (
        <>
        {nav()}{children}
    </>);
};

export default Layout;
